/****** Object:  Schema [Masters]    Script Date: 18/09/2021 11:43:23 ******/
IF NOT EXISTS (SELECT * FROM sys.schemas WHERE name = N'Masters')
EXEC sys.sp_executesql N'CREATE SCHEMA [Masters]'
GO
/****** Object:  Table [Masters].[Countries]    Script Date: 18/09/2021 11:43:23 ******/
SET ANSI_NULLS ON;
GO
SET QUOTED_IDENTIFIER ON;
GO
IF NOT EXISTS
 (
   SELECT     
      *
   FROM     
      [sys].[objects]
   WHERE
          object_id
          = OBJECT_ID(N'[Masters].[Countries]')
          AND [type] IN(N'U')
 )
  BEGIN
    CREATE TABLE [Masters].[Countries]
    (
       [GeoId]                 [INT] NOT NULL
     , [ISO]                   [NVARCHAR](3) NULL
     , [Native Name]           [NVARCHAR](200) NULL
     , [English Name]          [NVARCHAR](200) NULL
     , [Windows]               [NVARCHAR](3) NULL
     , [DDI]                   [SMALLINT] NULL
     , [Currency Name]         [NVARCHAR](100) NULL
     , [English Currency Name] [NVARCHAR](100) NULL
     , [Currency Symbol]       [NVARCHAR](5) NULL
     , [ISOCurrency]           [NVARCHAR](10) NULL
     , [InUse]                 [BIT] NOT NULL
     , [IsMetric]              [BIT] NOT NULL
     , [Flag]                  [IMAGE] NULL
     , [Longitude]             [DECIMAL](18, 6) NULL
     , [Latitude]              [DECIMAL](18, 6) NULL
     , CONSTRAINT [PK_Countries] PRIMARY KEY CLUSTERED([GeoId] ASC)
       WITH(STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF,
OPTIMIZE_FOR_SEQUENTIAL_KEY = OFF) ON [PRIMARY]
    )
    ON [PRIMARY] TEXTIMAGE_ON [PRIMARY];
  END;
GO
/****** Object:  Table [Masters].[Languages]    Script Date: 18/09/2021 11:43:23 ******/
SET ANSI_NULLS ON;
GO
SET QUOTED_IDENTIFIER ON;
GO
IF NOT EXISTS
 (
   SELECT     
      *
   FROM     
      [sys].[objects]
   WHERE
          object_id
          = OBJECT_ID(N'[Masters].[Languages]')
          AND [type] IN(N'U')
 )
  BEGIN
    CREATE TABLE [Masters].[Languages]
    (
       [Culture]            [NVARCHAR](20) NOT NULL
     , [Local Name]         [NVARCHAR](100) NULL
     , [English Name]       [VARCHAR](100) NULL
     , [LCID]               [SMALLINT] NOT NULL
     , [ANSI Code Page]     [SMALLINT] NULL
     , [OEM Code Page]      [SMALLINT] NULL
     , [Mac Code Page]      [SMALLINT] NULL
     , [EBCDIC Code Page]   [SMALLINT] NULL
     , [List Separator]     [NVARCHAR](2) NULL
     , [RightToLeft]        [BIT] NOT NULL
     , [NumberFormatJSON]   [NVARCHAR](MAX) NULL
     , [DateTimeFormatJSON] [NVARCHAR](MAX) NULL
     , [TextInfoJSON]       [NVARCHAR](MAX) NULL
     , [IsNeutralCulture]   [BIT] NULL
     , [InUse]              [BIT] NULL
     , CONSTRAINT [PK_Languages] PRIMARY KEY CLUSTERED([Culture] ASC)
       WITH(STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF,
OPTIMIZE_FOR_SEQUENTIAL_KEY = OFF) ON [PRIMARY]
    )
    ON [PRIMARY] TEXTIMAGE_ON [PRIMARY];
  END;
GO
/****** Object:  Table [Masters].[LanguagesByCountry]    Script Date: 18/09/2021 11:43:23 ******/
SET ANSI_NULLS ON;
GO
SET QUOTED_IDENTIFIER ON;
GO
IF NOT EXISTS
 (
   SELECT     
      *
   FROM     
      [sys].[objects]
   WHERE
          object_id
          = OBJECT_ID(N'[Masters].[LanguagesByCountry]')
          AND [type] IN(N'U')
 )
  BEGIN
    CREATE TABLE [Masters].[LanguagesByCountry]
    (
       [Culture] [NVARCHAR](20) NULL
     , [GeoId]   [INT] NULL
     , [InUse]   [BIT] NOT NULL
    )
    ON [PRIMARY];
  END;
GO
